      color: 'white',
      padding: '10px 20px',
      fontSize: '18px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center'
    }}>
      <div style={{ fontWeight: 'bold' }}>ðŸ›¸ Alien Invasion</div>
      <button
        onClick={onActivateCreate}
        style={{
          backgroundColor: '#444',
          color: 'white',
          border: 'none',
          padding: '8px 16px',
          borderRadius: '8px',
          cursor: 'pointer',
          fontSize: '16px'
        }}
      >
        âš¡ Create Landing
      </button>
    </nav>
  );
}
